SALT = b'I7\x8e\xbd@\x15*\xd8\\\x1e\x1d\xf1]r\xdc`'

def decrypt_and_run(password):

    try:
        
        kdf = PBKDF2HMAC(
            algorithm=hashes.SHA256(),
            length=32,
            salt=SALT,
            iterations=100000,
        )
        key = base64.urlsafe_b64encode(kdf.derive(password.encode()))
        
        
        cipher = Fernet(key)
        script_code = cipher.decrypt(ENCRYPTED_DATA)
        
        
        exec(script_code)
    except Exception as e:
        print(f"错误: {e}")
        sys.exit(1)

